Short-wave infrared
1.610
20


B12
Short-wave infrared
2.190
20



When viewing multi-band imagery that includes data from outside the visible spectrum, we have to choose how to map each band to one of the three visible channels (red, green, or blue) available for rendering on digital displays.  A true color composite is a rendering that displays visible blue (B02 from Sentinel-2) in the blue channel, visible green (B03) in the green channel, and visible red (B04) in the red channel.  Any other mapping of satellite image bands to display channels is a false color composite.
There are a collection of Sentinel-2 L2A products hosted as Cloud-Optimized GeoTIFFs on Amazon S3.  In this exercise, we'll render one of these on a map.
First, reset your index.html so we're ready to render a full page map:




    OpenLayers

      @import "node_modules/ol/ol.css";


      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }








Now we'll import two new components we haven't used before:

the ol/source/GeoTIFF source for working with multi-band raster data
the ol/layer/WebGLTile layer for manipulating data tiles with shaders on the GPU

Update your main.js to load and render a remotely hosted GeoTIFF file on a map:
import GeoTIFF from 'ol/source/GeoTIFF.js';
import Map from 'ol/Map.js';
import TileLayer from 'ol/layer/WebGLTile.js';
import View from 'ol/View.js';
import {getCenter} from 'ol/extent.js';
import {transformExtent} from 'ol/proj';

// metadata from https://s3.us-west-2.amazonaws.com/sentinel-cogs/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A/S2B_21HUB_20210915_0_L2A.json
const projection = 'EPSG:32721';

const extent = transformExtent(
  [-59.19991, -35.32718, -57.98062, -34.32183],
  'EPSG:4326',
  projection,
);

const source = new GeoTIFF({
  sources: [
    {
      url: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A/TCI.tif',
    },
  ],
});

const layer = new TileLayer({
  source: source,
});

new Map({
  target: 'map-container',
  layers: [layer],
  view: new View({
    projection: projection,
    center: getCenter(extent),
    extent: extent,
    zoom: 1,
  }),
});

The working example at http://localhost:5173/ shows a map with a GeoTIFF rendered in a WebGL tile layer.
A true color rendering of a Sentinel-2 GeoTIFF
The trickiest part here is finding the URL for an image that you might be interested in.  To do that, you can try searching in the EO (Earth Observation) Browser.  If you have the aws command line interface installed, you can also list the s3://sentinel-cogs/ bucket contents to get the paths for images by the Sentinel-2 grid cell identifier and date.  For example, to search for images around Buenos Aires from September, 2021:
aws s3 ls s3://sentinel-cogs/sentinel-s2-l2a-cogs/21/H/UB/2021/9/ --no-sign-request

The next hardest part is figuring out what projection and extent are appropriate for the map view.  In the next step, we'll make that easier.

cog/simplified-view.html.body:
Simplifying the map's view configuration
In the previous example, we had to configure the map's view with information about the spatial reference system and location of the image.
The first thing we needed to know was an identifier for the spatial reference system. In this case, the GeoTIFF is accompanied by STAC metadata that includes this projection information (see the proj:epsg property).
const projection = 'EPSG:32721';

The second piece of metadata we needed to know was the bounding box or extent of the image. This is also included in the STAC metadata in geographic coordinates (see the bbox array). We needed to transform this from geographic coordinates into EPSG:32721 (or WGS 84 / UTM zone 21S). OpenLayers has support for transforming coordinates to and from UTM projections, so we used this to transform the image extent.
const extent = transformExtent(
  [-59.19991, -35.32718, -57.98062, -34.32183],
  'EPSG:4326',
  projection,
);

With this information, we were able to configure the view for the map:
new Map({
  target: 'map-container',
  layers: [layer],
  view: new View({
    projection: projection,
    center: getCenter(extent),
    extent: extent,
    zoom: 1,
  }),
});

GeoTIFF imagery extends regular TIFF imagery with special "geo" tags that provide information about things like the spatial reference system and coordinate location of the imagery.  The ol/source/GeoTIFF source in OpenLayers parses this information and can ideally be used to configure a map's view.
The source.getView() method of the GeoTIFF source returns a promise for view properties (like projection, center, extent, and zoom) that resolves when the GeoTIFF metdata has been parsed.  The map constructor now accepts a view option that can be a promise for these same properties.  So instead of digging through the metadata ourselves to find things like projection and extent, we can provide the map with a promise for view properties from the source.
Update your main.js so that the map constructor uses this new method for getting view properties from the source:
new Map({
  target: 'map-container',
  layers: [layer],
  view: source.getView(),
});

Now you can remove the projection, extent, and related imports (View, transformExtent, and getCenter) from your main.js file.
You should find the same result as before at http://localhost:5173/ – only this time we had to write less code!
A true color rendering of a Sentinel-2 GeoTIFF

cog/false-color.html.body:
False color composite
In the previous step, we used the ol/source/GeoTIFF source to render a true color image from a single, multi-band source (with red, green, blue, and alpha bands).  In this example, we'll pull in data from outside the visible spectrum and use it to render a false color composite.
We want to render a false color composite that highlights vegetation over bare soil areas.  Chlorophyll-rich vegetation is bright in the near-infrared (Sentinel-2 B08) portion of the spectrum compared with its reflectance in visible wavelengths.  By contrast, bare soil is not as bright in near-infrared compared with its reflectance in visible wavelengths.  See the plot below for the reflectance spectra of green vegetation and bare soil shown with the Sentinel-2 bands.
Spectral signatures of vegetation (in green), soil (red), and water (blue).
To highlight vegetation in multi-spectral imagery, it is common to show the near-infrared (B08) reflectance in the red channel, red reflectance (B04) in the green channel, and green reflectance (B03) in the blue channel.  We can use the ol/source/GeoTIFF source to do this by loading three separate single-band GeoTIFF images in RGB order.
Update your main.js so the source looks like the following:
const source = new GeoTIFF({
  sources: [
    {
      // near-infrared reflectance
      url: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A/B08.tif',
      max: 5000,
    },
    {
      // red reflectance
      url: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A/B04.tif',
      max: 5000,
    },
    {
      // green reflectance
      url: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A/B03.tif',
      max: 5000,
    },
  ],
});

Reload http://localhost:5173/ to see your false color composite.
A false color rendering of a Sentinel-2 GeoTIFF

cog/ndvi.html.body:
Band math
We have seen how the ol/source/GeoTIFF source can be used to render true and false color composites.  We did this by rendering scaled reflectance values directly into one of the red, green, or blue display channels.  It is also possible to run calculations on reflectance values from a GeoTIFF (or other data tile source) and map the output values to RGBA color values.
The ol/layer/WebGLTile layer accepts a style property that can be used to control source rendering.  In this example, we'll use math expressions to calculate the Normalized Difference Vegetation Index (NDVI) from the same Sentinel-2 sources used in the previous examples.
The NDVI is the ratio of the difference between near-infrared (NIR) and red to the sum of near-infrared and red reflectance values.
NDVI = (NIR - RED) / (NIR + RED)
This normalized difference provides an index of green vegetation density or health.  In dividing the difference in NIR and red reflectance by the sum, the index is normalized against variations in brightness or illumination.  The idea is that vegetated sunny slopes should have a similar index as vegetated shady slopes.
To render NDVI values, we need to configure our source to use the near-infrared (B08) and red (B04) bands.  Update your main.js script so the source looks like this:
const source = new GeoTIFF({
  sources: [
    {
      // red reflectance
      url: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A/B04.tif',
      max: 10000,
    },
    {
      // near-infrared reflectance
      url: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A/B08.tif',
      max: 10000,
    },
  ],
});

Next, we'll create the expression for calculating NDVI from the source's input bands.  Add the following variables to your main.js:
// near-infrared is the second band from above
const nir = ['band', 2];

// near-infrared is the first band from above
const red = ['band', 1];

const difference = ['-', nir, red];
const sum = ['+', nir, red];

const ndvi = ['/', difference, sum];

The expressions above use an array-based syntax of this form: [operator, ...arguments].  The band operator accesses bands from the list of sources for the ol/source/GeoTIFF – where the first configured band is 1, the second is 2, etc.  The -, +, and / operators calculate the difference, sum, and ratio of their input arguments.  The ndvi expression will result in a value between -1 (not very vegetated) and 1 (very vegetated).  The next step is to map these values to colors.
The ol/layer/WebGLTile layer's style takes a color property that determines the final output color for each pixel.  We want to interpolate colors between the unvegetated (brownish) and vegetated (green) NDVI values.  To do this, we use an interpolate operator, applying linear interpolation between a number of stop values.
Edit your main.js so the layer definition looks like this:
const layer = new TileLayer({
  source: source,
  style: {
    color: [
      'interpolate',
      ['linear'],
      ndvi,
      -0.2, // ndvi values 
If everything worked out, you should see your NDVI visualization at http://localhost:5173/.
NDVI generated from a Sentinel-2 GeoTIFF
Choosing these stop values and colors is hard work.  Next up we will pull in a helper library to do this for us.

cog/colormap.html.body:
More colors!
The colormap package is a nice utility library for creating color maps.  This library has already been added as a dependency for the project.  To import it, edit your main.js to include the line below:
import colormap from 'colormap';

The colormap module exprts a function that returns an array of RGBA color values from one of the named color maps.  As seen in the previous example, we want an array of values that looks like this:
[stopValue0, color0, stopValue1, color1, stopValue1, stopValue2, color2, ...]

To create such an array, we'll write a function that takes a name for the color map, a min stop value, a max stop value, a number of steps, and an option to reverse the array of colors from the colormap function.  Add the following function to your main.js:
function getColorStops(name, min, max, steps, reverse) {
  const delta = (max - min) / (steps - 1);
  const stops = new Array(steps * 2);
  const colors = colormap({colormap: name, nshades: steps, format: 'rgba'});
  if (reverse) {
    colors.reverse();
  }
  for (let i = 0; i 
Now we can modify our layer style's color expression to use an array of stop and color values.  Edit the layer definition in main.js to use our new function:
The layer:
const layer = new TileLayer({
  source: source,
  style: {
    color: [
      'interpolate',
      ['linear'],
      ndvi,
      // color ramp for NDVI values
      ...getColorStops('earth', -0.5, 1, 10, true),
    ],
  },
});

Reload http://localhost:5173/ to see your new color map applied to the NDVI output.
NDVI generated from a Sentinel-2 GeoTIFF

cog/visualizations.html.body:
Visualization chooser
In the previous examples, we have seen a true color composite, a false color composite, and an NDVI rendering of the same Sentinel-2 image.  It would be nice to allow users to choose from one of these visualizations and more without having to change our code each time.  To do this, we'll create a list of available visualizations and add a  element to our page to let users choose which to display.
In addition to the true color, false color, and NDVI visualizations, we'll add a new Normalized Difference Water Index (NDWI).  This is similar to NDVI except that it can be used to monitor changes in water bodies.
NDWI = (GREEN - NIR) / (GREEN + NIR)
As we've seen, each visualization needs to have an array of sources (these are the URLs for single- or multi-band GeoTIFFs), an optional max value for scaling GeoTIFF values, and an optional style for rendering the layer.  In addition, we'll give each visualization a name for displaying to the user.
Edit your main.js to include the visualizations data below:
const visualizations = [
  {
    name: 'True Color',
    sources: ['TCI'],
  },
  {
    name: 'False Color',
    sources: ['B08', 'B04', 'B03'],
    max: 5000,
  },
  {
    name: 'NDVI',
    sources: ['B04', 'B08'],
    max: 10000,
    style: {
      color: [
        'interpolate',
        ['linear'],
        ['/', ['-', ['band', 2], ['band', 1]], ['+', ['band', 2], ['band', 1]]],
        ...getColorStops('earth', -0.5, 1, 10, true),
      ],
    },
  },
  {
    name: 'NDWI',
    sources: ['B03', 'B08'],
    max: 10000,
    style: {
      color: [
        'interpolate',
        ['linear'],
        ['/', ['-', ['band', 1], ['band', 2]], ['+', ['band', 1], ['band', 2]]],
        ...getColorStops('viridis', -1, 1, 10, true),
      ],
    },
  },
];

Now instead of creating our GeoTIFF source and layer once, we need a function to create these when the user chooses a visualization.  This function will take a base URL and a visualization and will return a layer. Edit your main.js to remove the source and layer definitions and include this function instead:
function createLayer(base, visualization) {
  const source = new GeoTIFF({
    sources: visualization.sources.map((id) => ({
      url: `${base}/${id}.tif`,
      max: visualization.max,
    })),
  });

  return new TileLayer({
    source: source,
    style: visualization.style,
  });
}

Next we can change the map definition in main.js so it doesn't include any layers at all (these will be added when the user selects a visualization):
const map = new Map({
  target: 'map-container',
});

Now we need a way for users to choose which visualization to show.  For this, we'll add a  element to the index.html just before the  tag:




To get this  element to display over the map in the top right corner, add the following block to the  tag in your index.html:
#controls {
  position: absolute;
  top: 20px;
  right: 20px;
}

With the  element in place, we need to populate it with an  for each of the visualization names.  To do this, add the following to your main.js somwhere below the visualizations array:
const visualizationSelector = document.getElementById('visualization');
visualizations.forEach((visualization) => {
  const option = document.createElement('option');
  option.textContent = visualization.name;
  visualizationSelector.appendChild(option);
});

Finally, we will create a function to update the map with a new layer based on the selected visualization.  We'll add this function as a change listener on our  element and call it to initalize our application:
function updateVisualization() {
  const visualization = visualizations[visualizationSelector.selectedIndex];
  const base =
    'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A';

  const layer = createLayer(base, visualization);
  map.setLayers([layer]);

  map.setView(layer.getSource().getView());
}

visualizationSelector.addEventListener('change', updateVisualization);
updateVisualization();

Now http://localhost:5173/ should show a visualization chooser.
Visualization chooser
Nice!  Now the user can choose what type of visualization to render.  But wouldn't it be nice to be able to change the imagery source too?  That's next.

cog/viz-plus.html.body:
Visualization chooser (continued)
The final missing piece of our COG explorer is to make it so the user can choose the imagery source.  While this section is already getting quite long, you may be able to tell that there is not that much more work involved in adding an image chooser.  Let's do it!
The first thing we need to do is come up with a list of images that should be displayed.  For each image, we want to display a name to show the user in a  element, and we need to have a base for the GeoTIFF URL.  So we'll want to add something like this to your main.js:
const images = [
  {
    name: 'Buenos Aires',
    base: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/21/H/UB/2021/9/S2B_21HUB_20210915_0_L2A',
  },
  {
    name: 'Minneapolis',
    base: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/15/T/WK/2021/9/S2B_15TWK_20210918_0_L2A',
  },
  {
    name: 'Cape Town',
    base: 'https://sentinel-cogs.s3.us-west-2.amazonaws.com/sentinel-s2-l2a-cogs/34/H/BH/2021/9/S2B_34HBH_20210922_0_L2A',
  },
];

Next, we'll add another  element to let the user choose the image.  In your index.html, adjust the controls to look like this:





Back to the JavaScript, we need to populate that  element with one  for each imagery source.  In your main.js add the following:
const imageSelector = document.getElementById('image');
images.forEach((image) => {
  const option = document.createElement('option');
  option.textContent = image.name;
  imageSelector.appendChild(option);
});

Now we just need to make a minor adjustment to the function that updates our visualization so it grabs the base URL from the selected imagery source.  In main.js edit the updateVisualization function and surrounding lines so it looks something like this:
let previousBase;
function updateVisualization() {
  const visualization = visualizations[visualizationSelector.selectedIndex];
  const base = images[imageSelector.selectedIndex].base;
  const newBase = base !== previousBase;
  previousBase = base;

  const layer = createLayer(base, visualization);
  map.setLayers([layer]);

  if (newBase) {
    map.setView(layer.getSource().getView());
  }
}

visualizationSelector.addEventListener('change', updateVisualization);
imageSelector.addEventListener('change', updateVisualization);
updateVisualization();

Note that we also only now update the view if the user has selected a new imagery source.  This is nicer than zooming out to the full extent whenever a new visualization type is selected.
Reload http://localhost:5173/. Boom!
COG explorer

vectortile/map.html.body:
The VectorTile layer
We now know how to load tiled images, and we have seen different ways to load and render vector data. But what if we could have tiles that are fast to transfer to the browser, and can be styled on the fly? Well, this is what vector tiles were made for. OpenLayers supports vector tiles through the VectorTile layer.
A world map rendered from vector data
We'll start with the same markup in index.html as in the Basics exercise.




    OpenLayers

      @import "node_modules/ol/ol.css";


      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }








As usual, we save index.html in the root of our workshop folder.
For the application, we'll start with a fresh main.js in the root of the workshop folder, and add the required imports:
import MVT from 'ol/format/MVT';
import VectorTileLayer from 'ol/layer/VectorTile';
import VectorTileSource from 'ol/source/VectorTile';
import {Map, View} from 'ol';
import {fromLonLat} from 'ol/proj';

The data source we are going to use is a simple map of the countries of the world from Natural Earth data, served as vector tiles by GeoServer.
The map setup we're going to create here is the same that we have used in previous exercises:
const map = new Map({
  target: 'map-container',
  view: new View({
    center: fromLonLat([0, 0]),
    zoom: 2,
  }),
});

The layer type we are going to use this time is a VectorTileLayer, with a VectorTileSource:
const layer = new VectorTileLayer({
  source: new VectorTileSource({
    format: new MVT(),
    url:
      'https://ahocevar.com/geoserver/gwc/service/tms/1.0.0/' +
      'ne:ne_10m_admin_0_countries@EPSG%3A900913@pbf/{z}/{x}/{-y}.pbf',
    maxZoom: 14,
  }),
});
map.addLayer(layer);

Our data source provides only zoom levels 0 to 14, so we need to pass this information to the source. Vector tile layers are usually optimized for a tile size of 512 pixels, which is also the default for the VectorTile source's tile grid. The data provider requires us to display some attributions, which we are adding to the source configuration as well.
As you can see, a VectorTileSource is configured with a format and a url, just like a VectorSource. The MVT format parses Mapbox Vector Tiles. Like with raster tiles, the tile data is accessed by zoom level and x and y coordinates of the tile. Therefore, the URL includes a {z} placeholder for the zoom level, and {x} and {y} placeholders for the tile coordinates.
The working example at http://localhost:5173/ shows an unstyled vector tile map like this:
A world without style

vectortile/bright.html.body:
Making things look bright
Obviously the map we currently have needs some style. Styles for VectorTile layers work exactly the same way as for Vector layers. The styles described there will work here as well.
For maps like this, creating data driven styles like for vector layers is straightforward. But vector tiles are also being used for street maps, where styling will usually differ a lot depending on the map's zoom level. In these cases, doing all this by hand may be too time-consuming.
In the history of web mapping, there have been many attempts to create tools and formats for styling maps. The most popular formats were probably SLD and CartoCSS. A graphical tool that comes to mind is Atlas Styler. But none of these formats or tools were really convenient to use.
Mapbox finally came up with Mapbox Studio, a very user-friendly style editor, and the Mapbox Style format. The Mapbox Style format is easy to read and write manually, and supported by a growing number of applications. A graphical Open Source editor, Maputnik, is available as an independent alternative to Mapbox Studio for creating and modifying Mapbox Style files.
Using a Mapbox Style definition
With the additional ol-mapbox-style library, there are several ways to use vector tile layers with Mapbox styles in OpenLayers. The easiest is the MapboxVector layer from the ol-mapbox-style import. It is configured with a url that points to a Mapbox Style document. Let's try it out.
First, add the required import:
import {MapboxVectorLayer} from 'ol-mapbox-style';

The tile dataset we are going to use is https://tiles.openfreemap.org/styles/bright. Alternatively, if you have a Mapbox account, you could use the ancestor of that map from Mapbox (see comments in the code below).
const layer = new MapboxVectorLayer({
  styleUrl: 'https://tiles.openfreemap.org/styles/bright',
  // or, instead of the above, try
  // styleUrl: 'mapbox://styles/mapbox/bright-v9',
  // accessToken: 'Your token from https://mapbox.com/'
});
map.addLayer(layer);

The above code replaces the VectorTileLayer from the previous step. When everything works as expected, we can finally enjoy a nice looking world map, and zoom in to Belém!
A bright map of Belém
Build a complete map from a Mapbox Style definition
The Mapbox Style format was not just made for styling vector data. It was made to describe an entire map, with all its sources and layers, and its initial view configuration (e.g. center and zoom level).
With ol-mapbox-style's apply() function, it is also possible to create a whole map from a Mapbox Style. If you want to try that, you could replace the whole code in main.js with this:
import {apply} from 'ol-mapbox-style';
apply('map-container', 'https://tiles.openfreemap.org/styles/bright');

After trying this, switch back to the previous code, as we will be looking into how to interact with a vector tile map.

vectortile/interact.html.body:
Interact with VectorTile features
The nice thing about vector tiles is that we can interact with features, because we have the data on the client. One thing to note though is that vector tiles are optimized for rendering. This means that features only contain attributes that are needed for filtering and rendering, and that geometries are optimized for the rendered resolution and clipped near the tile boundary.
For this exercise, we're going to draw a box around the features at the pointer's location when hovering over them.
Adding a vector layer for exploring the data
We will be highlighting the geometries of the hovered features and show a label with their source layers on a separate vector layer. The following imports are needed, and we add them next to the other imports in main.js:
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';

Next, we can create a source for the layer, the layer, and add it to the map:
const source = new VectorSource();
const info = new VectorLayer({
  source: source,
  style: {
    'stroke-color': 'red',
    'stroke-width': 4,
    'text-value': ['coalesce', ['get', 'layers'], ''],
    'text-padding': [2, 2, 2, 2],
    'text-offset-y': -15,
    'text-font': '16px sans-serif',
    'text-background-fill-color': 'gray',
  },
});
map.addLayer(info);

Here we are using flat styles, which were added to the library not so long ago. As you can see, it is also possible to access feature properties:
'text-value': ['coalesce', ['get', 'layers'], ''],

This retrieves the value of the layers property, which we will be showing as label. The coalesce expression allows to provide a fallback value when the first expression does not return a value. This comes in handy because only the point feature we add in the next step will have a features property, but not the features copied over from the VectorTile layers.
Interacting with the map
Now it is time to add a pointermove listener to the map, which gets all the features at the pointer location and adds their bounding boxes to the layer. We need two additional imports for that:
import Feature from 'ol/Feature';
import Point from 'ol/geom/Point';

Finally we can add the code that clears the current contents of the source and adds the features at the pointer location and a feature for a label listing the layers of these features as new content:
map.on('pointermove', function (event) {
  source.clear();
  //! [get-features]
  const features = map.getFeaturesAtPixel(event.pixel, {
    layerFilter: (layer) => layer !== info,
  });
  //! [get-features]
  source.addFeatures(features);
  //! [layers-label]
  const layers = features.map((feature) => feature.get('layer'));
  source.addFeature(
    new Feature({
      geometry: new Point(event.coordinate),
      layers: Array.from(new Set(layers)).join(', '),
    })
  );
  //! [layers-label]
});

Let's dissect this huge code snippet a bit:
const features = map.getFeaturesAtPixel(event.pixel, {
  layerFilter: (layer) => layer !== info,
});

This gets the features under the pointer, but excluding the info layer, which is the layer we're copying vector tile features from. This is because we do not want to get duplicated results in the next rendering cycle.
const layers = features.map((feature) => feature.get('layer'));
source.addFeature(
  new Feature({
    geometry: new Point(event.coordinate),
    layers: Array.from(new Set(layers)).join(', '),
  })
);

Here we get the source layers from the features we copied over, and create a new feature with a point at the pointer coordinate, and the list of source layers as layers property.
Array.from(new Set(layers)) takes the layers array, which may contain duplicate layer entries, turns it into a Set, and converts it back to an array. This is an easy way to remove duplicates from an array in JavaScript.
Now when hovering over the map, the result should look like this:
Hovering over the map

webgl/meteorites.html.body:
Rendering meteorites with Canvas 2D
Starting with OpenLayers 6, each layer in a map has an independent renderer.  Previously, all layer rendering was managed by a single map renderer and depended on a single rendering strategy.  So prior to OpenLayers 6, you needed to choose between Canvas 2D or WebGL rendering for all layers.  In recent OpenLayers versions, you can have a map composed of layers with different rendering strategies.  For example, you can render some layers with a Canvas 2D renderer and others with a WebGL renderer.
The ol/layer/Vector class uses Canvas 2D to render points, lines, or polygons.  This layer has a full featured renderer with a ton of flexibility in feature styling.  For very large numbers of features, WebGL might be a more appropriate technology.  In this module, we'll start by using Canvas 2D to render 45,000 meteorite locations and then migrate the example to WebGL.
First, edit your index.html so we're ready to render a full page map:




    OpenLayers

      @import "node_modules/ol/ol.css";


      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }








Next we'll fetch and parse data from a local CSV file, add the resulting features to a vector source, and render it on the map with a vector layer.
The meteorites.csv file has data in it that looks like this:
name,mass,year,reclat,reclong
Aachen,21,1880,50.775000,6.083330
...
We're going to use the convenient papaparse library to parse the csv. It has already been added as dependency to the workshop, so we can import its parse function without the need to run npm install. We only need to write a short complete handler function that creates OpenLayers Features from the rows in the csv, with mass and year being numbers, not strings, and Point geometries representing the latitude ( reclat) and longitude (reclong) of the meteorite impact.
Update your main.js to load and render a local CSV file with data representing meteorite impacts:
import Feature from 'ol/Feature';
import Point from 'ol/geom/Point';
import TileLayer from 'ol/layer/Tile';
import VectorLayer from 'ol/layer/Vector';
import {Map, View} from 'ol';
import {StadiaMaps, Vector as VectorSource} from 'ol/source';
import {fromLonLat} from 'ol/proj';
import {parse} from 'papaparse';

const source = new VectorSource();
parse('./data/meteorites.csv', {
  download: true,
  header: true,
  complete(result) {
    source.addFeatures(
      result.data.map(
        (row) =>
          new Feature({
            mass: parseFloat(row.mass) || 0,
            year: parseInt(row.year) || 0,
            geometry: new Point(
              fromLonLat([parseFloat(row.reclong), parseFloat(row.reclat)]),
            ),
          }),
      ),
    );
  },
});

const meteorites = new VectorLayer({
  source: source,
  style: {
    'circle-radius': 7,
    'circle-fill-color': 'rgba(255, 0, 0, 0.5)',
  },
});

new Map({
  target: 'map-container',
  layers: [
    new TileLayer({
      source: new StadiaMaps({
        layer: 'stamen_toner',
      }),
    }),
    meteorites,
  ],
  view: new View({
    center: [0, 0],
    zoom: 2,
  }),
});

After fetching and parsing the data, features are added to a vector source.  This source is rendered in a vector layer over a tile layer.  We're applying very simple styling here - red, semi-transparent circles. The point is just to see how it feels to use the map with 45,000 features rendered with Canvas 2D.
Meteorite impact sites

webgl/animated.html.body:
Animating meteorite impacts
So far we have managed to get data from our CSV file rendered with WebGL, but the map is pretty uninteresting.  We're using the mass of the meteorite to determine the radius of the circle, but we're not making use of the meteorite impact date that we parsed as the year property in our point features.
The year property for our meteorite features have values that range from 1850 to 2015.  We'll set up an animation loop that increments the current year, render meteorites on their impact year, and then decrease their size and opacity as time passes.
As a first step, we'll get the animation loop going and render the current year to a  on top of the map.  Add the following markup below the map container in your index.html:


Edit the  block to include the following rule:
#year {
  position: absolute;
  bottom: 1em;
  left: 1em;
  color: white;
  -webkit-text-stroke: 1px black;
  font-size: 2em;
  font-weight: bold;
}

Now, back in main.js, we'll declare some variables to represent the time range of the data and the rate at which we want the animation to proceed.  Add the following code above your const meteorites declaration in main.js:
const minYear = 1850;
const maxYear = 2015;
const span = maxYear - minYear;
const rate = 10; // years per second

const start = Date.now();

To be able to access the current year in style expressions, we need to use the variables constructor option on the meteorites layer and include the currentYear (whose value will start with minYear):
variables: {
  currentYear: minYear,
},
// ...other options like `style`

Style variables are values that are available in var expressions in the layer style.
Next we need to assign our map instance to a map variable that we can reference later:
const map = new Map({

Below the map configuration, add the following render function to get the animation loop started. In this function, we'll update the current year and call updateStyleVariables() on the meteorites layer to update the year used in the style expressions.
const yearElement = document.getElementById('year');

function render() {
  const elapsed = (rate * (Date.now() - start)) / 1000;
  const currentYear = Math.round(minYear + (elapsed % span));
  meteorites.updateStyleVariables({currentYear: currentYear});
  yearElement.innerText = currentYear;
  requestAnimationFrame(render);
}

render();

If you got it all right, you should see the years rolling by in the lower left corner above the map.
Through the years
We also add another layer option to the meteorites layer, which will improve the performance of the animation – we do not need to process hit detection data in every anmiation step.
disableHitDetection: true,

Now to show the temporal context on the map, we only want to show each meteorite for a period of 10 years, starting at the time of its impact. For this, we're adding a filter to the meteorites layer's style object:
filter: ['between', ['get', 'year'], periodStart, ['var', 'currentYear']],

The filter references a periodStart variable, which is an expression on its own that we need to define. While we're at it, we define a few more of those to use in the style object. Let's add the following above the const meteorites layer definition:
const period = 10;
const periodStart = ['-', ['var', 'currentYear'], period];
const decay = [
  'interpolate',
  ['linear'],
  ['get', 'year'],
  periodStart,
  0,
  ['var', 'currentYear'],
  1,
];

The decay is an expression we're going to use to fade out circles by reducing their size and opacity. It gives us a value between 0 and 1, which we can apply as multiplier for the fade effect. To use it for reducing the size over time, we have to modify the circle-radius in the style object:
'circle-radius': [
  '*',
  decay,
  ['+', ['*', ['clamp', ['*', ['get', 'mass'], 1 / 20000], 0, 1], 9], 4],
],

The existing expression is the fourth line of the new circle-radius expression.
For reducing the opacity over time, we also apply the decay to the circle-fill-color:
'circle-fill-color': ['color', 255, 0, 0, ['*', 0.5, decay]],

Previously we had an rgba color, now we use a color expression consisting of r, g, b and alpha values. The alpha value is now dynamic and considers the decay.
Meteor shower
Congratulations!

data-tiles/map.html.body:
Map setup
Edit your index.html so we're ready to render a full page map:




    OpenLayers

      @import "node_modules/ol/ol.css";


      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }








Clear out your main.js and add the following imports:
import Map from 'ol/Map.js';
import TileLayer from 'ol/layer/WebGLTile.js';
import View from 'ol/View.js';
import XYZ from 'ol/source/XYZ.js';
import {fromLonLat} from 'ol/proj.js';

In this section, we'll be using tiles from MapTiler.  If you don't have an account already, you can sign up for a free one and use your key in these examples.  After signing up for an account, find your default API key, and add it to main.js:
const key = '';

To verify that everything works, we'll create a map with a single layer using your API key.
const attributions =
  '&copy; MapTiler ' +
  '&copy; OpenStreetMap contributors';

new Map({
  target: 'map-container',
  layers: [
    new TileLayer({
      source: new XYZ({
        url: 'https://api.maptiler.com/maps/streets/{z}/{x}/{y}.png?key=' + key,
        attributions: attributions,
        crossOrigin: 'anonymous',
        tileSize: 512,
      }),
    }),
  ],
  view: new View({
    center: fromLonLat([-58.3816, -34.6037]),
    zoom: 11,
  }),
});

A map of Buenos Aires

data-tiles/elevation.html.body:
Render elevation data
MapTiler provides a global tileset with elevation data encoded as PNG files.
Let's see what these tiles look like by adding them to our map.  In your main.js, create a new layer that uses the MapTiler terrain-rgb tileset:
const layer = new TileLayer({
  opacity: 0.6,
  source: new XYZ({
    url:
      'https://api.maptiler.com/tiles/terrain-rgb/{z}/{x}/{y}.png?key=' + key,
    maxZoom: 10,
    tileSize: 512,
    crossOrigin: 'anonymous',
  }),
});

After adding that layer to your map, you should be able to reload the page some oddly colored tiles shown over your base layer.  The elevation data in the Terrain-RGB tiles is encoded in the red, green, and blue channels.  So while this data isn't meant to be rendered directly, it is interesting to look at.
Terrain-RGB tiles rendered over a base map

data-tiles/sea-level.html.body:
Render sea level
In the previous step, we rendered the Terrain-RGB tiles directly on the map.  What we want to do is render sea level on the map instead.  And we want users to be able to adjust the height above sea level and see the adjusted height rendered on the map.  We'll use a WebGL tile layer to work with the elevation data directly and get the user input from an input slider on the page.
Let's add the controls to the page first.  In your index.html, add the following label and input slider:

  Sea level

  + m


Now add some style to those controls (in the  of your index.html):
#slider {
  position: absolute;
  bottom: 1rem;
  width: 100%;
  text-align: center;
  text-shadow: 0px 0px 4px rgba(255, 255, 255, 1);
}

Instead of directly rendering the R, G, B, A values from the Terrain-RGB tiles, we want to manipulate the pixel values before rendering.  The WebGL tile layer allows you to manipulate pixel values in a style expression before rendering them.  This expression is evaluated for every pixel in the input source.
First, import the WebGLTile layer (in main.js):
import TileLayer from 'ol/layer/WebGLTile.js';

The elevation values in the terrain-rgb tiles are encoded as red, gree, and blue values (from 0-255) in the tiles according to the following formula:
elevation = -10000 + ((R * 256 * 256 + G * 256 + B) * 0.1)
We can use the WebGL style expression language to represent that formula.  Add the expression below to your main.js.  This expression decodes the input elevation data — transforming red, green, and blue values into a single elevation measure.
// band math operates on normalized values from 0-1
// so we scale by 255 to align with the elevation formula
// from https://cloud.maptiler.com/tiles/terrain-rgb/
const elevation = [
  '+',
  -10000,
  [
    '*',
    0.1 * 255,
    [
      '+',
      ['*', 256 * 256, ['band', 1]],
      ['+', ['*', 256, ['band', 2]], ['band', 3]],
    ],
  ],
];

Create a WebGL tile layer that uses the expression above:
const layer = new TileLayer({
  opacity: 0.6,
  source: new XYZ({
    url:
      'https://api.maptiler.com/tiles/terrain-rgb/{z}/{x}/{y}.png?key=' + key,
    maxZoom: 10,
    tileSize: 512,
    crossOrigin: 'anonymous',
  }),
  style: {
    variables: {
      level: 0,
    },
    color: [
      'case',
      ['
The color expression above uses a case expression to color values at or below sea level as blue.  Elevation values above sea level will be transparent (with an alpha value of 0).
Next we need to listen for changes on the slider input and update the seaLevel style variable when the user adjusts the value.
const control = document.getElementById('level');
const output = document.getElementById('output');
const listener = function () {
  output.innerText = control.value;
  layer.updateStyleVariables({level: parseFloat(control.value)});
};
control.addEventListener('input', listener);
control.addEventListener('change', listener);
output.innerText = control.value;

With all this in place, the map should now have a slider that let's users control changes in sea level.
Sea level rise
